import React from 'react'
import mealsImage from '../../assets/meals(1).img';
const Header = () => {
  return (
    <>
    <header>
        <h1>React Meals</h1>
        <button>Cart</button>
    </header>
    <div>
        <img src={mealsImage}></img>
    </div>
    </>
  )
}

export default Header
